(61, 80, 1, 33, 34, 1, 'html', 'com_otportfoliomanager', 'HTML', 'html', '', '<p><strong>HTML, or Hypertext Markup Language</strong> is used to create web pages. Site authors use HTML to format text as titles and headings, to arrange graphics on a webpage, to link to different pages within a website, and to link to different websites.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"category_layout":"","image":"images\\/com_otportfoliomanager\\/category\\/185x220-html-256px.png"}', '', '', '{"author":"","robots":""}', 314, '0000-00-00 00:00:00', 314, '2015-01-22 03:19:10', 0, '*', 1),
(62, 79, 1, 31, 32, 1, 'graphic', 'com_otportfoliomanager', 'Graphic', 'graphic', '', '<p>We offer design solutions for Corporate Visual Identity, Advertising and Brand Management. We provide our clients with original and imaginative design ideas aimed at stimulating their customers.<br /><br /><br />Print design include identity Logos and Branding, Brochures, magazines, advertisements, Catalogues, Newsletters, Reports… Well, aren’t these Ambassadors of your organization? we offer Print design services enabling to transform your visitors into customers.<br /><br /></p>', 1, 0, '0000-00-00 00:00:00', 1, '{"category_layout":"","image":"images\\/com_otportfoliomanager\\/category\\/185x220-graphics-256px.png"}', '', '', '{"author":"","robots":""}', 314, '0000-00-00 00:00:00', 314, '2015-01-22 03:18:52', 0, '*', 1),
(63, 78, 1, 37, 38, 1, 'joomla', 'com_otportfoliomanager', 'Joomla', 'joomla', '', '<p>Joomla is an award-winning content management system (CMS), which enables you to build Web sites and powerful online applications. Many aspects, including its ease-of-use and extensibility, have made Joomla the most popular Web site software available. Best of all, Joomla is an open source solution that is freely available to everyone.</p>\r\n<h2>What''s a content management system (CMS)?</h2>\r\n<p>A content management system is software that keeps track of every piece of content on your Web site, much like your local public library keeps track of books and stores them. Content can be simple text, photos, music, video, documents, or just about anything you can think of. A major advantage of using a CMS is that it requires almost no technical skill or knowledge to manage. Since the CMS manages all your content, you don\\''t have to.</p>', 1, 314, '2015-01-22 03:20:07', 1, '{"category_layout":"","image":"images\\/com_otportfoliomanager\\/category\\/185x220-joomla-256px.png"}', '', '', '{"author":"","robots":""}', 0, '0000-00-00 00:00:00', 314, '2015-01-22 03:20:07', 0, '*', 1),
(64, 77, 1, 35, 36, 1, 'wordpress', 'com_otportfoliomanager', 'Wordpress', 'wordpress', '', '<p><strong>WordPress</strong> is a free and open source blogging tool and a dynamic content management system (CMS) based on PHP and MySQL. It has many features including a plug-in architecture and a template system. WordPress is currently the most popular CMS in use on the Internet.</p>\r\n<h2><span id="&quot;Features&quot;">Features</span></h2>\r\n<p>WordPress has a web template system using a template processor.</p>\r\n<h3><span id="&quot;Themes&quot;">Themes</span></h3>\r\n<p>WordPress users may install and switch between themes. Themes allow users to change the look and functionality of a WordPress website or installation without altering the informational content. Themes may be installed by using the WordPress "Dashboard " administration tool, or by uploading theme folders via FTP. The PHP and HTML code in themes can also be edited for more advanced customizations.</p>\r\n<h3><span id="&quot;Plugins&quot;">Plugins</span></h3>\r\n<p>One very popular feature of WordPress is its rich plugin architecture which allows users and developers to extend its abilities beyond the features that are part of the base install; WordPress has a database of over 18,000 plugins with purposes ranging from SEO to adding widgets.</p>\r\n<h3><span id="&quot;Widgets&quot;">Widgets</span></h3>\r\n<p>Widgets are small modules that offer users drag-and-drop sidebar content placement and implementation of many plugins '' extended abilities. Widgets allow WordPress developers to add functionality to their sites. These small modules can be used to add functionality such as a slideshow, Facebook-like box, small news slider, and more.</p>\r\n<h3><span id="&quot;Multi-user_and_multi-blogging&quot;">Multi-user and multi-blogging</span></h3>\r\n<p>Prior to WordPress 3.0, WordPress supported one blog per installation, although multiple concurrent copies may be run from different directories if configured to use separate database tables. WordPress Multi-User (WordPress MU, or just WPMU) was a fork of WordPress created to allow multiple blogs to exist within one installation that is able to be administered by a centralized maintainer. WordPress MU makes it possible for those with a website to host their own blogging community, as well as control and moderate all the blogs from a single dashboard. WordPress MU adds eight new data tables for each blog.</p>\r\n<p>WordPress MU merged with WordPress as part of the 3.0 release.</p>\r\n<h3><span id="&quot;Mobiles&quot;">Mobiles</span></h3>\r\n<p>Native applications exist for WebOS, Android, iOS (iPhone, iPod Touch, iPad), Windows Phone 7, and BlackBerry which provide access to some of the features in the WordPress Admin panel and work with WordPress.com and many WordPress.org blogs.</p>\r\n<h3><span id="&quot;Other_features_of_note&quot;">Other features of note</span></h3>\r\n<p>WordPress also features integrated link management; a search engine–friendly, clean permalink structure; the ability to assign nested, multiple categories to articles; and support for tagging of posts and articles. Automatic filters are also included, providing standardized formatting and styling of text in articles (for example, converting regular quotes to smart quotes). WordPress also supports the Trackback and Pingback standards for displaying links to other sites that have themselves linked to a post or article.</p>', 1, 0, '0000-00-00 00:00:00', 1, '{"category_layout":"","image":"images\\/com_otportfoliomanager\\/category\\/185x220-wordpress-256px.png"}', '', '', '{"author":"","robots":""}', 314, '0000-00-00 00:00:00', 314, '2015-01-22 03:19:40', 0, '*', 1),
