(256, 69, 'About Us', 'about-us', '<h2>Who We Are?</h2>\r\n<p><strong>"OURTEAM"</strong>, a complete IT solution provider mainly in business of software development, multimedia and web solutions. The company was formed in November 2010 and maintained a phenomenal growth over the years. "OURTEAM" achieved total financial stability since inception and grown solely based on internally generated funds.</p>\r\n<p> </p>\r\n<p>We have believed in providing our customer''s with Best Price, Best Quality, Best Reliability and Best Support. Our strength is our customer base, their support, business relationship and advices which have helped us to get better by the day.</p>\r\n<p> </p>\r\n<p><strong>"OURTEAM"</strong> has top-quality engineers, resulting in a dynamic, responsive workforce. The company has a strong customer focus. Employees are incentive to maximize customer satisfaction.Our clients are spread across the globe; we serve the needs of large to small business and industrial groups.</p>\r\n<p> </p>\r\n<h3>Our Vision</h3>\r\n<p>Our team is built upon a foundation of passion, creativity and vision. To provide world class, Consistently deliver ingenious, comprehensive yet cost-effective IT solutions and services for Global market by creating a Professionally stimulating and happy environment for "OUR TEAM" where Professionals thrive alongside the growth of our company.</p>\r\n<p> </p>\r\n<h3>Our Mision</h3>\r\n<p>Skillfully applying the most sought-after, fast-growing pertinent Technology to yield total solutions in the most critical business areas. Customer satisfaction with value added solutions, state of the art technology, cost effective solutions and a reliable support system.</p>', '', 1, 34, '2012-02-13 17:49:47', 314, '', '2015-03-10 16:24:20', 314, 0, '0000-00-00 00:00:00', '2012-02-13 17:49:47', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 7, 6, '', '', 1, 1300, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(257, 68, 'Our Services', 'our-services', '<h3>IT Outsourcing &amp; Remote workforce</h3>\r\n<p>Here at ourteam.co.in we have a dedicated &amp; expert technical team of highly skilled web designer, graphic designer &amp; web developer. We offer offshore IT outsourcing solutions &amp; Remote workforce at very competitive price according to your time zone. The arrangements &amp; infrastructure could take the shape of entire virtual team as per your project requirement.</p>\r\n<p> </p>\r\n<h3>WEB DEVELOPMENT</h3>\r\n<p>We work on Joomla, Oscommerce, google Checkout, Drupal, CakePHP, Zend, PhpMyDirectory, phpFox, Wordpress, Core Php &amp; MySql, Ajax/Jquery/JavaScript.</p>\r\n<ul>\r\n<li>we follow wc3 rules in developing website.</li>\r\n<li>All browser compatibility</li>\r\n<li>We use open source technology,hence the website is easy to operate &amp; maintain &amp; regular changes can be done as per client requirements.</li>\r\n<li>Web hosting on dedicated us based international server.</li>\r\n</ul>\r\n<p> </p>\r\n<h3>WEB DESIGNING</h3>\r\n<p>We specialize in Web Design Services, Website Redisign, Logo Designing, Flash Intros, Banner Designing, Attractive &amp; Dynamic Template Designing, Email Template Designing.</p>\r\n<p> </p>\r\n<h3>SEO (SEARCH ENGINE OPTIMIZATION)</h3>\r\n<p>SEO is the technique of gaining top Serch engine ranking on google &amp; other top search engines with Specific keywords, Product/Services you offer by making it more relevant than other competitive websites.</p>\r\n<p>We have a dedicated technical team which will be working round the clock to make your website Search engine optimized.</p>\r\n<p>(SEO as per products,services, keywords etc.)</p>\r\n<p> </p>\r\n<h3>Online Marketing &amp; Brand/Product/Services Promotion</h3>\r\n<p>In this fast moving Internet age The fastest &amp; cheapest way to reach your target market &amp; customer segment is online.</p>\r\n<p>Take one more step towards developing your business effectively &amp; efficiently.</p>\r\n<p>Promote your Business,Brand, Product or Services through our Economic &amp; Result oriented Online Marketing Services</p>\r\n<p>Email Marketing</p>\r\n<p>Bulk Sms Marketing</p>\r\n<p>Attractive offer Email template design</p>\r\n<p> </p>\r\n<h3>ONLINE BRAND PROMOTION BASED ON YOUR PRODUCT/SERVICES.</h3>\r\n<p>Business &amp; industry oriented online brand promotions strategies,overall planning &amp; execution,.</p>\r\n<p> </p>\r\n<h3>CONTENT &amp; ARTICLE WRITING</h3>\r\n<p><strong>CONTENT WRITING</strong> The content is the key &amp; one of the most important aspect of your website,It makes the website informative,increases visits &amp; ranking of your websites &amp;.to make it search engine &amp; end user friendly.</p>\r\n<p><strong>ARTICLE WRITING</strong> People search for their desired topics on the Internet. .These articles should be informative and well written to attract and retain visitors. This can contribute to the success of the website. Trust <a href="undefined/" target="_blank">ourteam.co.in</a> ,a <strong>well-known content writing company</strong>, for creative and interesting articles on the website.</p>\r\n<p>Here at <a href="http://team.co.in" target="_blank">ourteam.co.in</a>, we have a dedicated &amp; experienced team of Content &amp; Article writers.</p>\r\n<p> </p>', '', 1, 34, '2012-02-13 17:49:47', 314, '', '2015-03-10 16:48:57', 314, 0, '0000-00-00 00:00:00', '2012-02-13 17:49:47', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":