(332, 73, 'PSD To HTML', 'psd-to-html', '<div class="order-process-info">\r\n<div class="p2h_h1">SEE HOW EASILY THE ORDER PROCESS GOES</div>\r\n<div class="p2h_p">\r\n<div class="step1">\r\n<div class="step">1</div>\r\n<div class="p2h_txt">Place an Order\r\n<div class="mr50">Use <a title="Order Now" href="order-now">order now link</a></div>\r\n</div>\r\n</div>\r\n<div class="p2h_arrow"> </div>\r\n<div class="step2">\r\n<div class="step">2</div>\r\n<div class="p2h_txt">Pay for Service using PayPal\r\n<div class="mr50"><a title="Payment Option " href="how-do-i-pay">Payment Option </a></div>\r\n</div>\r\n</div>\r\n<div class="p2h_arrow"> </div>\r\n<div class="step3">\r\n<div class="step">3</div>\r\n<div class="p2h_txt">Receive best Markup (HTML/CSS)\r\n<div class="mr50">See <a title="Sample Code" href="samples">sample code</a></div>\r\n</div>\r\n</div>\r\n<div class="clearpix"> </div>\r\n</div>\r\n<div class="clearpix"> </div>\r\n<div class="p2h_div">All you have to do is place an order, upload your design and make a payment.</div>\r\n<div class="p2h_div">Developers chop-chop your design to xhtml &amp; css. You will receive all coded files on your email.</div>\r\n<div class="p2h_div"><br /><hr /></div>\r\n</div>\r\n<div class="deepest">\r\n<div class="p2h_cont_1">\r\n<div class="module-header">\r\n<h3 class="module-title">NON-DISCLOSURE AGREEMENT</h3>\r\n</div>\r\n<p class="p2hp">NDA for all information you share with us, including artwork, contact information and client notes — it will remain confidential.</p>\r\n<a class="a-3" href="non-disclosure-agreement">— read more</a></div>\r\n<div class="p2h_cont_2">\r\n<div class="module-header">\r\n<h3 class="module-title">FREE 30 DAYS SUPPORT</h3>\r\n</div>\r\n<p class="p2hp">Only OurTeam.co.in gives you 30 days free support for Professional Package.</p>\r\n<a class="a-3" href="our-services/psd-to-html/faq#support">— read more</a></div>\r\n<div class="p2h_cont_3">\r\n<div class="module-header">\r\n<h3 class="module-title">100% MONEYBACK GUARANTEE</h3>\r\n</div>\r\n<p class="p2hp">Your satisfaction is very important to us<br /> and 100% guaranteed. If for are not satisfied<br /> with the results, contact us to get a refund.</p>\r\n<a class="a-3" href="our-services/psd-to-html/faq#guarantee">— read more</a></div>\r\n</div>', '', 1, 34, '2012-12-31 20:18:33', 314, '', '2015-01-18 14:34:59', 314, 0, '0000-00-00 00:00:00', '2012-12-31 20:18:33', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 19, 3, '', '', 3, 53, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(333, 206, 'FAQ', 'faq', '<div id="faq">\r\n<h2>Frequently Asked Questions</h2>\r\n<div class="box"><strong>So exactly what do you offer ?</strong><br />We take your designs (PSD, AI, JPG, PNG, TIFF) and convert them to standard compliant, hand-coded, table-less xHTML/CSS based layout. We also implement designs into CMS theme / template / skins for blogs, shopping carts, ecommerce platforms, web apps.</div>\r\n<dl></dl>\r\n<div class="box"><strong>How do I submit my order?You can place you order by clicking here, for a practical manner we suggest you to upload everything on a zip/rar file with the following structure:</strong><br /> — Typography folder (if needed)<br /> — PSD⁄Editable files folder<br /> — PNG⁄JPG files folder (to easily preview the final pages to be coded)<br /> — Specs folder (include here a doc⁄text⁄pdf file with extra isntructions if needed)</div>\r\n<dl></dl>\r\n<div class="box"><strong>So how much do you charge for these services ?</strong><br />The pricing is made according to number of pages, turnaround time and custom options selected. Our order page calculates estimated costs automatically. The final price in your order will be confirmed by one of our managers after reviewing the specs of your projects and your files. If you make a payment over the final quote, we will refund you the difference asap and if you make a payment under the final quote we will ask you to pay the difference. <a href="contact-us" title="Contact Us" rel="fancybox">Contact us</a> if you need an exact quote or more specific questions.</div>\r\n<dl></dl>\r\n<div class="box"><strong>What is your delivery time?</strong><br />We have different turnaround times, depending on what you selected when placing your order. Our standard times-frames for orders up to 10 pages are 5 business days, 2-3 business days and 1 business day. Remember that those deadlines are estimated and if your order has more than 10 pages, it will take extra time.Delivery time is only for PSDtoxHTML/CSS or Email Templates work, CMS is scheduled separately, depending on the requirements.</div>\r\n<dl></dl>\r\n<div class="box"><strong>Do i have to pay upfront?</strong></div>\r\n<div class="box">For the time being, we only work with upfront payments. However, in case of multiple page orders, you can pay upfront for the markup of only the first page. We will create the xHTML/CSS for the first page and send it to you. You review the markup and if you''re satisfied with the code, you submit the payment for the rest of the pages. It''s that simple.</div>\r\n<dl></dl>\r\n<div class="box"><strong>What different discounts you offer ?</strong><br />Our pricing is highly competitive. We offer 50% discount on additional sub pages. There is bulk order discounts &amp; discounts for customers that send work to us on regular basis. <a href="contact-us" title="Contact Us" rel="fancybox">Contact us</a> if you want discounts on bulk order.</div>\r\n<dl></dl>\r\n<div class="box"><strong>Will you setup website on our hosting?</strong><br />Yes, We can install it on your web hosting for a nominal price depending on level of complexity of project.</div>\r\n<dl></dl>\r\n<div class="box"><strong>Do you offer design services?<br /></strong>Yes we do offer design services. We have some great designers on our team. Contact us with your project requirements and we will give you a custom quote.</div>\r\n<dl></dl>\r\n<div class="box"><strong>What about web development/programming ?<br /></strong>We totally can do some work for you. Contact us with your project details for us to provide quote.</div>\r\n<dl></dl>\r\n<div class="box"><strong>What font replacement techniques do you offer ?</strong><br />We offer all major font replacement techniques like sIFR, Cufon, Typekit, Google Web fonts &amp; @font-face (with EOT, WOFF support).</div>\r\n<dl></dl>\r\n<div class="box"><strong>What javascript framework do you use ?<br /></strong>Although jQuery is our favorite Javascript framework. But we do work with Prototype, Script.aculo.us sometimes.</div>\r\n<dl></dl>\r\n<div class="box"><strong>Which email clients you test HTML emails on ?<br /></strong>We test HTML emails on all major email clients both web based and desktop based which includes Yahoo Mail, Gmail, Hotmail, Apple mail, Microsoft Outlook, Mozilla Thunderbird.</div>\r\n<dl></dl>\r\n<div class="box"><strong>What browsers do you support ?</strong><br />We support all major web browsers IE 7+, Firefox 3+, Safari, Opera 9+ and Google Chrome. We test websites on mac, windows and linux platforms.</div>\r\n<dl></dl>\r\n<div class="box"><strong>What if i lost my project files?</strong><br />Don''t worry we keep backup of all project files for 6 months.</div>\r\n<dl></dl>\r\n<div class="box"><strong>What payment methods do you use?<br /></strong>We accept all major credit cards ( AMEX, VISA, Master Card, Discover ) &amp; Paypal. We also accept echeck &amp; bank wire for larger amounts.</div>\r\n<dl></dl>\r\n<div class="box">Information Collected OurTeam will require you to provide some information in order to provide our services to you. This is an example of the type of information we will require from you to be collected or submitted to OurTeam through our order form, product request, and other pages. You will most likely be asked to share the following information:<br /> <br /> — Email address<br /> — Client information requests<br /> — Order-specific information, including source files and project notes<br /> — Some specific details of your project in general</div>\r\n<div class="box"> </div>\r\n<div id="moneyback-guarantee" class="pageset-1-text-1 mt10"><a name="guarantee"></a>\r\n<h2><strong>HOW DOES MONEY BACK GUARANTEE WORK?</strong></h2>\r\n<p class="pr20">We guarantee to give you the money back if: We can''t carry out your order, you will cancel your order before we start working on it, you are not happy with the results when reviewing the project on our developing server. Note: The refund is NOT issued if the request for the refund was received after the project *zip files were sent or after the installation on the client''s server.</p>\r\n</div>\r\n<div id="90-days-support" class="pageset-1-text-1 mt10"><a name="support"></a>\r\n<h2><strong>HOW DOES FREE 90 DAYS SUPPORT WORK?</strong></h2>\r\n<p class="pr20">Chop-Chop.Org gives you 90 days free support for Professional Package and 30 days free support for Standard Package.</p>\r\n</div>\r\n<dl></dl>\r\n<div class="box">How we use your information The personal information you share with OurTeam is only used to complete your order. We do not and will not share this information with outside parties.<br /> <br /> Your email address is used only for notifications about the status of your order or for company announcements and special promos. It is not used for any other purpose, and it is not shared it with outside parties.<br /> <br /> Finally, we never use or share your project or any information related to your project with any other parties. All the information provided to OurTeam online will remain safe and secure at all times.</div>\r\n<dl></dl></div>', '', 1, 11, '2013-01-03 10:24:43', 314, '', '2013-01-03 11:06:07', 63, 0, '0000-00-00 00:00:00', '2013-01-03 10:24:43', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 0, '', '', 1, 687, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
