(334, 74, 'NON-DISCLOSURE AGREEMENT', 'non-disclosure-agreement', '<div id="1-1">\r\n<h2>WE RESPECT OUR CLIENTS PRIVACY</h2>\r\n<p>The OurTeam.co.in takes cognizance of our client''s business policies and keeps it confidential.<br /> It amortizes 100% Non-Disclosure Guaranteed Agreement for all information that you share with us, including artwork, contact information and client notes will remain confidential. To prevent unauthorized access, maintain data accuracy, and ensure the correct use of information, we have put in place appropriate physical, electronic, and managerial procedures to safeguard and secure the information we collect.</p>\r\n</div>\r\n<div id="1-1">\r\n<h2>YOUR ARTWORK IS SAFE</h2>\r\n<p>In fact, we adjudicate our client''s artwork as demesne possession and so, it will never be used for any adverse reason. We assert under oath that it will never be depleted for any of our other clients. Neither, there will be any kind of blandishment of your contract information or anything endowed by you to any other company or individual under any accepted fact.</p>\r\n</div>', '', 1, 34, '2013-01-03 10:55:25', 314, '', '2015-01-18 14:34:59', 314, 0, '0000-00-00 00:00:00', '2013-01-03 10:55:25', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 3, 2, '', '', 1, 36, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
