INSERT INTO `zx3lv_extensions` (`extension_id`, `name`, `type`, `element`, `folder`, `client_id`, `enabled`, `access`, `protected`, `manifest_cache`, `params`, `custom_data`, `system_data`, `checked_out`, `checked_out_time`, `ordering`, `state`) VALUES
(817, 'System - Google Analytics', 'plugin', 'GoogleAnalytics', 'system', 0, 1, 1, 0, '{"name":"System - Google Analytics","type":"plugin","creationDate":"19th April 2010","author":"Peter Bui","copyright":"Copyright (c) 2015 PB Web Development. All rights reserved.","authorEmail":"peter@pbwebdev.com.au","authorUrl":"http:\\/\\/pbwebdev.com","version":"4.6.1","description":"\\n        \\n        <p style=\\"text-align:left\\">\\n            New and update rewrite of the popular Google Anaytics for Joomla FREE. Asynchronous code for Google Analytics is now\\n            old and has been superseeded by Google''s new \\"UNIVERSAL ANALYTICS\\".\\n        <\\/p>\\n        <p style=\\"text-align:left\\">\\n            This plugin will allow you to choose between the two options of the new universal analytics code or the old\\n            asynchronous version of the analytics code.\\n        <\\/p>\\n\\n        <h2 style=\\"text-align:left\\">Upgrade to PRO<\\/h2>\\n\\n        <p style=\\"text-align:left\\">\\n        You can also upgrade to <a href=\\"http:\\/\\/nicheextensions.com\\/extensions\\/google-analytics\\" taget=\\"_blank\\"><strong>Google Analytics PRO<\\/strong><\\/a> for more features and fine tuning of your analytics.\\n        <\\/p>\\n\\n        <h2 style=\\"text-align:left\\">Documentation<\\/h2>\\n        <p style=\\"text-align:left\\">\\n            Read the documentation at: <a href=\\"http:\\/\\/nicheextensions.com\\/documentation\\/3-google-analytics-for-joomla\\" target=\\"_blank\\">http:\\/\\/nicheextensions.com\\/documentation\\/3-google-analytics-for-joomla<\\/a> for more\\n            information.\\n        <\\/p>\\n\\n        <h2 style=\\"text-align:left\\">An Overview<\\/h2>\\n\\n        <iframe width=\\"100%\\" height=\\"auto\\" src=\\"https:\\/\\/www.youtube.com\\/embed\\/58QMSW5bbCs\\" frameborder=\\"0\\" allowfullscreen><\\/iframe>\\n\\n        <h2 style=\\"text-align:left\\">FAQs<\\/h2>\\n        <h3 style=\\"text-align:left\\">Why doesn''t Google say it can''t detect my analytics code when clearly I can see it on the website?<\\/h3>\\n        <p style=\\"text-align:left\\">\\n        This usually happens when the information is sent to Google before the plugin was enabled and is being caches. Check back in 12 hours and make sure that the information still isn''t coming through. Make sure you also check the ID for any spaces before or after the ID as this can also cause issues.<\\/p>\\n        <h3 style=\\"text-align:left\\">How can I be certain that the information is being passed through?<\\/h3>\\n        <p style=\\"text-align:left\\">\\n        You can also use the Google analytics Real Time tracking to see if the data is coming in or not. If you see active users on the site with the real time data then the information is coming in to Google Analytics from your website.<\\/p>\\n        \\n    ","group":"","filename":"GoogleAnalytics"}', '{"type":"universal","code":"UA-30484176-1","domain":"ourteam.co.in","verify":""}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
(818, 'PLG_LAZYLOADFORJOOMLA', 'plugin', 'lazyloadforjoomla', 'system', 0, 0, 1, 0, '{"name":"PLG_LAZYLOADFORJOOMLA","type":"plugin","creationDate":"2015-02-15","author":"Viktor Vogel","copyright":"Copyright 2015 Viktor Vogel. All rights reserved.","authorEmail":"admin@kubik-rubik.de","authorUrl":"http:\\/\\/joomla-extensions.kubik-rubik.de\\/","version":"3-9","description":"PLG_LAZYLOADFORJOOMLA_XML_DESCRIPTION","group":"","filename":"lazyloadforjoomla"}', '{"framework_type":"0","noscript_fallback":"0","exclude_imagenames":"","exclude_imagenames_toggle":"0","exclude_components":"","exclude_components_toggle":"0","exclude_urls":"","exclude_urls_toggle":"0","exclude_editor":"1","exclude_bots":"1","botslist":"bot,spider,crawler,libwww,search,archive,slurp,teoma,facebook,twitter","viewslist":"component,print","image_class":"","donation_code":""}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
(819, 'JA System Lazyload Plugin', 'plugin', 'jalazyload', 'system', 0, 1, 1, 0, '{"name":"JA System Lazyload Plugin","type":"plugin","creationDate":"Dec 2013","author":"Joomla! Project","copyright":"Copyright (c), J.O.O.M Solutions Co., Ltd. All Rights Reserved.","authorEmail":"webmaster@joomlart.com","authorUrl":"www.joomlart.com","version":"1.0.6","description":"\\n\\t\\n\\t\\t<div style=''text-align: left;''>\\n\\t\\t<span style=\\"color: #008000;\\"><strong>JA Lazyload plugin for Joomla 2.5<\\/strong><\\/span><br \\/>\\n\\t\\t<p><img alt=\\"JA Lazyload Plugin\\" src=\\"http:\\/\\/www.joomlart.com\\/images\\/stories\\/extensions\\/joomla\\/ja_lazyload.png\\" \\/><\\/p>\\n\\t\\t<div style=\\"font-weight:normal\\">\\n\\t\\t\\t<p>Lazy Load is a jQuery plugin written in JavaScript. <br>\\n\\t\\t\\t\\tIt delays loading of images in long web pages. <br>\\n\\t\\t\\t\\tImages outside of viewport (visible part of web page) wont be loaded before user scrolls to them. <br>\\n\\t\\t\\t\\tThis is opposite of image preloading.<\\/p>\\n\\t\\t\\t\\n\\t\\t\\t<p>Using Lazy Load on long web pages containing many large images makes the page load faster. <br>\\n\\t\\t\\t\\tBrowser will be in ready state after loading visible images. In some cases it can also help to reduce server load.<\\/p>\\n\\t\\t\\t<p><a href=\\"http:\\/\\/www.appelsiini.net\\/projects\\/lazyload\\" title=\\"Lazy Load\\">Lazy Load<\\/a> is provided by by Mika Tuupola, originally inspired by <a href=\\"http:\\/\\/developer.yahoo.com\\/yui\\/imageloader\\/\\" title=\\"YUI ImageLoader\\">YUI ImageLoader<\\/a>  Utility by Matt Mlinac .<\\/p> <br \\/>\\n\\t\\t\\t<p>\\n\\t\\t\\t\\t<span style=\\"color: #008000;\\"><strong>Links:<\\/strong><\\/span><br \\/>\\n\\t\\t\\t\\t<ul>\\n\\t\\t\\t\\t\\t<li><a target=\\"_blank\\" href=\\"http:\\/\\/pm.joomlart.com\\/browse\\/JAECPLGLAZYLOAD\\" title=\\"Updates &amp; Versions\\">Updates &amp; Versions<\\/a><\\/li>\\n\\t\\t\\t\\t<\\/ul>\\n\\t\\t\\t<\\/p>\\n\\t\\t\\t<p>Copyright 2004 - 2013 <a title=\\"Visit Joomlart.com!\\" href=\\"http:\\/\\/www.joomlart.com\\/\\" target=\\"_blank\\">JoomlArt.com<\\/a>.<\\/p>\\n\\t\\t<\\/div>\\n\\t\\t<\\/div>\\n\\t\\n\\t","group":"","filename":"jalazyload"}', '{"lazyload_minwidth":"100","failure_limit":"10","threshold":"0","sharelimit":"5","display_effect":"show","load_invisible":"1","exclude":"menus=162"}', '', '', 314, '2016-06-30 03:46:43', 0, 0),
