(28, 256, 1, '', '2015-03-10 16:24:08', 314, 3397, '017cc07c8214a0acc18ba7a305370e2008306fe8', '{"id":256,"asset_id":"69","title":"About Us","alias":"about-us","introtext":"<h2>Who We Are?<\\/h2>\\r\\n<p><strong>\\"OURTEAM\\"<\\/strong>, a complete IT solution provider mainly in business of software development, multimedia and web solutions. The company was formed in November 2010 and maintained a phenomenal growth over the years. \\"OURTEAM\\" achieved total financial stability since inception and grown solely based on internally generated funds.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>We have believed in providing our customer''s with Best Price, Best Quality, Best Reliability and Best Support. Our strength is our customer base, their support, business relationship and advices which have helped us to get better by the day.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p><strong>\\"OURTEAM\\"<\\/strong> has top-quality engineers, resulting in a dynamic, responsive workforce. The company has a strong customer focus. Employees are incentive to maximize customer satisfaction.Our clients are spread across the globe; we serve the needs of large to small business and industrial groups.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>Our Vision<\\/h3>\\r\\n<p>Our team is built upon a foundation of passion, creativity and vision. To provide world class, Consistently deliver ingenious, comprehensive yet cost-effective IT solutions and services for Global market by creating a Professionally stimulating and happy environment for \\"OUR TEAM\\" where Professionals thrive alongside the growth of our company.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>Our Mision<\\/h3>\\r\\n<p>Skillfully applying the most sought-after, fast-growing pertinent Technology to yield total solutions in the most critical business areas. Customer satisfaction with value added solutions, state of the art technology, cost effective solutions and a reliable support system.<\\/p>","fulltext":"","state":1,"catid":"34","created":"2012-02-13 