(29, 257, 1, '', '2015-03-10 16:48:57', 314, 5120, '02affaca75f0c38648b5a5e96862a76ec5579c2c', '{"id":257,"asset_id":"68","title":"Our Services","alias":"our-services","introtext":"<h3>IT Outsourcing &amp; Remote workforce<\\/h3>\\r\\n<p>Here at ourteam.co.in we have a dedicated &amp; expert technical team of highly skilled web designer, graphic designer &amp; web developer. We offer offshore IT outsourcing solutions &amp; Remote workforce at very competitive price according to your time zone. The arrangements &amp; infrastructure could take the shape of entire virtual team as per your project requirement.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>WEB DEVELOPMENT<\\/h3>\\r\\n<p>We work on Joomla, Oscommerce, google Checkout, Drupal, CakePHP, Zend, PhpMyDirectory, phpFox, Wordpress, Core Php &amp; MySql, Ajax\\/Jquery\\/JavaScript.<\\/p>\\r\\n<ul>\\r\\n<li>we follow wc3 rules in developing website.<\\/li>\\r\\n<li>All browser compatibility<\\/li>\\r\\n<li>We use open source technology,hence the website is easy to operate &amp; maintain &amp; regular changes can be done as per client requirements.<\\/li>\\r\\n<li>Web hosting on dedicated us based international server.<\\/li>\\r\\n<\\/ul>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>WEB DESIGNING<\\/h3>\\r\\n<p>We specialize in Web Design Services, Website Redisign, Logo Designing, Flash Intros, Banner Designing, Attractive &amp; Dynamic Template Designing, Email Template Designing.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>SEO (SEARCH ENGINE OPTIMIZATION)<\\/h3>\\r\\n<p>SEO is the technique of gaining top Serch engine ranking on google &amp; other top search engines with Specific keywords, Product\\/Services you offer by making it more relevant than other competitive websites.<\\/p>\\r\\n<p>We have a dedicated technical team which will be working round the clock to make your website Search engine optimized.<\\/p>\\r\\n<p>(SEO as per products,services, keywords etc.)<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>Online Marketing &amp; Brand\\/Product\\/Services Promotion<\\/h3>\\r\\n<p>In this fast moving Internet age The fastest &amp; cheapest way to reach your target market &amp; customer segment is online.<\\/p>\\r\\n<p>Take one more step towards developing your business effectively &amp; efficiently.<\\/p>\\r\\n<p>Promote your Business,Brand, Product or Services through our Economic &amp; Result oriented Online Marketing Services<\\/p>\\r\\n<p>Email Marketing<\\/p>\\r\\n<p>Bulk Sms Marketing<\\/p>\\r\\n<p>Attractive offer Email template design<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>ONLINE BRAND PROMOTION BASED ON YOUR PRODUCT\\/SERVICES.<\\/h3>\\r\\n<p>Business &amp; industry oriented online brand promotions strategies,overall planning &amp; execution,.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<h3>CONTENT &amp; ARTICLE WRITING<\\/h3>\\r\\n<p><strong>CONTENT WRITING<\\/strong> The content is the key &amp; one of the most important aspect of your website,It makes the website informative,increases visits &amp; ranking of your websites &amp;.to make it search engine &amp; end user friendly.<\\/p>\\r\\n<p><strong>ARTICLE WRITING<\\/strong> People search for their desired topics on the Internet. .These articles should be informative and well written to attract and retain visitors. This can contribute to the success of the website. Trust <a href=\\"undefined\\/\\" target=\\"_blank\\">ourteam.co.in<\\/a> ,a <strong>well-known content writing company<\\/strong>, for creative and interesting articles on the website.<\\/p>\\r\\n<p>Here at <a href=\\"http:\\/\\/team.co.in\\" target=\\"_blank\\">ourteam.co.in<\\/a>, we have a dedicated &amp; experienced team of Content &amp; Article writers.<\\/p>\\r\\n<p>\\u00a0<\\/p>","fulltext":"","state":1,"catid":"34","created":"2012-02-13 17:49:47","created_by":"239","created_by_alias":"","modified":"2015-03-10 16:48:57","modified_by":"314","checked_out":"314","checked_out_time":"2015-03-10 16:24:59","publish_up":"2012-02-13 17:49:47","publish_down":"0000-00-00 00:00:00","images":"{\\"image_